import React from 'react';
import './CenterVideo.css';

const CenterVideo = () => {
	return (
		<div id='center-div-main' className='video-container'>
			{/* <video width='100%' height='auto' controls>
				<source
					src='https://www.youtube.com/watch?v=-Da8Mf5vg7o'
					type='video/mp4'
				/>
				Your browser does not support the video tag.
			</video> */}
			<video width='100%' height='auto' controls>
				<iframe
					title={`Youtube video with id ${videoId}`}
					width='100%'
					height='auto'
					src={`https://www.youtube.com/embed/${videoId}?controls=1&showinfo=0&rel=0`}
					frameBorder='0'
					allow='accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture'
					allowFullScreen
				/>
				Your browser does not support the video tag.
			</video>
			<iframe
				width='1520'
				height='577'
				src='https://www.youtube.com/embed/-Da8Mf5vg7o'
				title='Website Demo-Video Presentation'
				frameborder='0'
				allow='accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share'
				allowfullscreen>Play</iframe>
		</div>
	);
};

export default CenterVideo;
